function LoginPage() {
    return (
        <div className="login-signup-form-container">

            <h2>Login</h2>
            <form>
                <label>Email address</label>
                <input type="text"/>

                <label>Password</label>
                <input type="text"/>
            </form>
        </div>
    );
}

export default LoginPage;
